import { StyleSheet, Text, View } from "react-native";

const  styles = StyleSheet.create({
    container: {
      flex: 1,
      padding: 24,
      backgroundColor: "#eaeaea"
    },
    bottom: {
        width:'100%',
        backgroundColor:'black',
        height:'260px'
    }
  });

  export default styles
